import React , { Fragment }  from 'react';
import Nav from '../layout/Nav';
import Register from './RegisterUser';
import Alert from '../layout/Alert';

const Home = () => {
    return (
        <Fragment>
            <Nav />
            <br/><br /><br/>
            <Alert />
            <br/><br /><br/>
            <div className="container">
            <Register />
            </div>
        </Fragment>
    )
}

export default Home
